function initMap(){var e=new google.maps.Map(document.getElementById("map"),{zoom:2,center:{lat:26.2639368,lng:12.7765974},scrollwheel:!1}),o=locationCoords.map(function(e){return new google.maps.Marker({position:e})});new MarkerClusterer(e,o,{imagePath:"https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m"})}var google,locationCoords=[],locationName=[];$.ajax({url:"locations.json",dataType:"text",success:function(e){for(var o=$.parseJSON(e),t=0;t<o.length;t++){var a={lat:o[t].latlng[0],lng:o[t].latlng[1]},n=o[t].name;locationCoords.push(a),locationName.push(n)}for(var r=0;r<locationName.length;r++){var l="<li>"+locationName[r]+"</li>";document.getElementById("visitedList").innerHTML+=l}document.getElementById("congrats").innerHTML="<p>Congrats! You have visited "+locationName.length+" countries/territories.</p><p>"+Math.round(locationName.length/247*100)+"% of 247 countries/territories around the globe.</p>",initMap()}});